import './App.css';
import  { Link, Routes, Route } from "react-router-dom";
import Test from "./components/Test";

function App() {
  return (
    <div className="App">

          <ul>
           <li>
             <Link to="/">Home</Link>
           </li>
         </ul>
        <Routes>
                <Route path="/test" element={<Test />}>
                  <Test />
                </Route>
        </Routes>

    </div>
  );
}

export default App;
